define("dist/personalCenter/template/userPage/rightList.html",[],'{{ each rightList as item i }}\n<li data-id="{{item.itemId}}">\n    <a href="/f/{{item.itemId}}.html" target="_blank">\n        <div class="info">\n            <p>{{item.title}}</p>\n            <!-- <p>{{item.item_read_cnt ? item.item_read_cnt + \'阅读\' : \'\'}}</p> -->\n        </div>\n        <div class="pic">\n            <img src="{{item.coverUrl}}" alt="">\n            <span class="ico-data pos ico-{{item.categoryLevel5}}"></span>\n        </div>\n        \n    </a>\n   \n</li>\n{{/each}}'),define("dist/personalCenter/template/userPage/userPageList.html",[],"<div class=\"title\">TA的资料</div>\n<div class=\"tab\">\n    <div class=\"tab-item {{sortField == 'downNum' ? 'active' : '' }}\" type='downNum'>\n        <a href=\"?sort=downNum\">热门</a>\n    </div>\n    <div class=\"tab-item {{sortField == 'createTime' ? 'active' : '' }}\" type='createTime'>\n        <a href=\"?sort=createTime\">最新</a>\n    </div>\n    <div class=\"format\">\n        <div class=\"format-title\">{{ formatName }}<i></i></div>\n        <div class=\"format-list\">\n            <div class=\"format-list-item {{format == '' ? 'format-active' : ''}}\" format=''>全部</div>\n            <div class=\"format-list-item {{format == 'doc' ? 'format-active' : ''}}\" format='doc'>DOC</div>\n            <div class=\"format-list-item {{format == 'ppt' ? 'format-active' : ''}}\" format='ppt'>PPT</div>\n            <div class=\"format-list-item {{format == 'pdf' ? 'format-active' : ''}}\" format='pdf'>PDF</div>\n            <div class=\"format-list-item {{format == 'xls' ? 'format-active' : ''}}\" format='xls'>XLS</div>\n            <div class=\"format-list-item {{format == 'txt' ? 'format-active' : ''}}\" format='txt'>TXT</div>\n        </div>\n     </div> \n </div>\n<ul>\n    {{ each list.rows as item i }}\n    <li>\n        <a href=\"/f/{{item.id}}.html\">\n         <div class=\"pic\">\n             {{ if item.fileSmallPic }}\n             <img src=\"{{'http://pic.iask.com.cn/' + item.fileSmallPic}}\" alt=\"\">\n             {{else}}\n             <img src=\"/images/default-picture.png\" alt=\"\">\n             {{/if}}\n             <span class=\"ico-data pos ico-{{item.format}}\"></span>\n         </div>\n         \n         <div class=\"info\">\n             <p>{{item.title}}</p>\n             <p>{{item.readNum}}阅读 &nbsp; &nbsp;  {{item.totalPage}}页</p>\n         </div>\n        </a>\n    </li>\n    {{/each}}\n</ul>\n<!-- 暂无记录 -->\n{{ if list.rows.length == 0 }}\n<div class=\"no-record\">暂无记录</div>\n{{/if}}\n{{ if list.totalPages.length >1}}\n <div class=\"pagination-wrapper\">\n     <div class=\"page-list pagination\">\n         <div class=\"page-item js-page-item first\" data-currentPage=\"1\">首页</div>\n         {{if currentPage>1}}\n         <div class=\"page-item js-page-item prev\" data-currentPage={{currentPage-1}}>上一页</div> \n         {{/if}}\n         {{each list.totalPages}}\n             {{ if $index >currentPage-3 && $index <=+currentPage +3 }}\n             <div class=\"page-item js-page-item {{ currentPage == $index+1 ? 'active':''}}\"  data-currentPage={{+$index+1}}>\n                 {{$index+1}}\n             </div>\n             {{/if}}\n         {{/each}}\n\n         {{if currentPage <= list.totalPages.length -3}}\n             <div class=\"page-more page-item\">...</div>\n         {{/if}}\n         {{if currentPage < list.totalPages.length}}\n            <div class=\"page-item js-page-item\" data-currentPage={{+currentPage+1}}>下一页</div>\n          {{/if}}\n         <div class=\"page-item js-page-item\" data-currentPage={{list.totalPages.length}}>尾页</div>\n </div>\n</div>\n{{/if}}");